    __webpack_exports__["default"] = "<!-- #region 1st Parallax image-->\n<div class=\"parallax\" style=\"height: 350px; background-image: url('../../../assets/blog/organisation/organise-web-browsing/header.jpg');\">\n  <div class=\"imageTextCollage\"><a class=\"photoCred\" style=\"margin-top: 300px; float: right;\" href=\"https://unsplash.com\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"Download free do whatever you want high-resolution photos from Igor Miske\"><span style=\"display:inline-block;padding:2px 3px\"><svg xmlns=\"http://www.w3.org/2000/svg\" style=\"height:12px;width:auto;vertical-align:middle;top:-2px;fill:white\" viewBox=\"0 0 32 32\"><title>unsplash-logo</title><path d=\"M10 9V0h12v9H10zm12 5h10v18H0V14h10v9h12v-9z\"></path></svg></span><span style=\"display:inline-block;padding:2px 3px\">Unknown</span></a></div>\n</div>\n<!-- #endregion -->\n<div class=\"content\">\n    <div class=\"blog-layout\">\n      <!-- #region Tags -->\n      <div class=\"card\">\n        <div class=\"tags\" style=\"text-align:center\"> \n          <div class=\"tag\"> Tags: </div>\n          <div class=\"tag\"><p>#Organisation</p></div>\n          <div class=\"tag\"><p>#Self Development</p></div>\n          <div class=\"tag\"><p>#Web Browsing</p></div>\n          <div class=\"tag\"><p>#Declutter</p></div>\n        </div>\n      </div>\n      <!-- #endregion -->\n      <div class=\"leftcolumn\">\n        <div class=\"written-content-container\">\n          <!-- #region Written content -->\n          <div class=\"written-content\">\n            <br><br><h1><strong>How To Organise Your Web Browsing</strong></h1>\n            <br>\n            <!-- <p>Intro</p> -->\n            <br>\n            <p class=\"subheading\"><strong>1. Declutter Your Emails</strong></p>\n            <p>Have a look at the cluttered inbox below:</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/email-cluttered.PNG\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>A very cluttered inbox</p></div>\n            </div>\n            <br>\n            <p>This doesn't make me feel like reading anything. I don't understand most of the things that's there and feel very disorganised just by looking at it. \n              If I am ever in a situation where I need to backtrack any records, then so help me God - luckily, I've decluttered my inbox not too long ago, so here is what it looks like now:</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/email-folder2.PNG\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Much better</p></div>\n            </div>\n            <br>\n            <p>I have utilised the sidebar to create folders to categorise all my emails. As you can see, I have a <strong>Gaming</strong> folder where I put everything related to purchases on the PlayStation Store, or my PSN account in general.\n              Looking at the sidebar, I also have separate folders to store emails related to my Google accounts, and car (such as car insurance or receipts for repairs).\n              The gaming folder is nested under the 'Online Accounts' folder. This is what all the higher-level folders look like: </p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/email-folder1.PNG\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Root folder structure</p></div>\n            </div>\n            <br>\n            <p>I also have deleted and unsubscribed to a lot of things that I might have 'accidentally' signed up for just by visiting their website. This prevents spam emails from getting into your inbox in the first place.</p>\n            <br>\n            <p class=\"subheading\"><strong>2. Utilize The Bookmarks Bar to Organise Frequently Used Websites</strong></p>\n            <p>When you use the web, it can be a lot easier to just click on an icon to open a website. You can use this to save all the websites you use frequently, or even work-related websites that you need to remember (such as links to your work HR timesheets page).</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/bookmarks.jpg\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Use bookmarks to organise your web browsing</p></div>\n            </div>\n            <br>\n            <p>First, make sure the bookmarks bar is enabled. Depending on the web browser you use, there should be a setting to show the bookmarks bar.</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/bookmarks-4.PNG\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Use bookmarks to organise your web browsing</p></div>\n            </div>\n            <br>\n            <p>All you have to do is visit the website you want to save, and click on the star icon at the top. Here it is in Google Chrome:</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/bookmarks-2.jpg\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Add to bookmarks option in Google Chrome</p></div>\n            </div>\n            <br>\n            <p>And here it is in Firefox:</p>\n            <br>\n            <div style=\"text-align:center\">\n              <img src=\"../../../assets/blog/organisation/organise-web-browsing/bookmarks-3.PNG\" alt=\"image\" class=\"blog-image\"/>\n              <div class=\"content-photo-credit\"><p>Add to bookmarks option in Firefox</p></div>\n            </div>\n            <br>\n            <p class=\"subheading\"><strong>To Be Continued</strong></p>\n            <br>\n            <h4 class=\"blog-date\">19 May 2020</h4>\n            <h6 class=\"blog-date\">By <a href=\"https://www.instagram.com/vondreii/?hl=en\">@Vondreii</a></h6><br><br>\n          </div>\n          <!-- #endregion -->\n          <!-- #region Tags -->\n          <div class=\"tags\">\n            <div class=\"tag\"> Tags: </div>\n            <div class=\"tag\"><p>#Organisation</p></div>\n            <div class=\"tag\"><p>#Self Development</p></div>\n            <div class=\"tag\"><p>#Web Browsing</p></div>\n            <div class=\"tag\"><p>#Declutter</p></div>\n          </div>\n          <!-- #endregion -->\n        </div>\n      </div>\n      <div class=\"rightcolumn\" id=\"sticky-right-col\">\n        <!-- #region Ad -->\n        <div class=\"card\">\n          <br><div style=\"height:300px;background-image:url('../../assets/about/designer.jpg');background-size:cover;\"></div><br>\n        </div>\n        <!-- #endregion -->\n      </div>\n    </div>            \n    <!-- #region Follow Me -->\n    <div class=\"card\">\n      <br><h3 class=\"sidebar-bottom-headings\">FOLLOW ME</h3><h5 class=\"fadedText\">__________________</h5><br>\n      <div style=\"text-align:center\">\n        <a href=\"https://www.instagram.com/vondreii\"><img src=\"../../../assets/social/instagram.png\" alt=\"image\"/></a><span style=\"padding:10px\"></span>\n        <a href=\"https://www.linkedin.com/in/sharlene-von-drehnen\"><img src=\"../../../assets/social/linkedin.png\" alt=\"image\"/></a><span style=\"padding:10px\"></span>\n        <a href=\"https://github.com/vondreii\"><img src=\"../../../assets/social/github.png\" alt=\"image\" /></a><span style=\"padding:10px\"></span>\n      </div>\n      <br><br>\n    </div>\n    <!-- #endregion -->\n    <!-- #region More Like This -->\n    <br><br><h3 class=\"sidebar-bottom-headings\">MORE LIKE THIS</h3><br><h5 class=\"fadedText\">__________________</h5><br><br>\n    <div class=\"rows\">\n      <div class=\"column-3\"><div class=\"mini-card\">\n        <img src=\"../../../assets/blog/organisation/better-organise-your-files/mini-preview.jpg\" alt=\"image\" style=\"width:100%\">\n        <div class=\"card-container\">\n          <br><h2><strong>10 Tips To Better Organise Your Computer</strong></h2><br>\n          <p style=\"text-align:center\"><a routerLink=\"/blog/organisation/tips-to-better-organise-your-computer\">Read More >></a></p>\n        </div>\n      </div></div><br><br>\n      <div class=\"column-3\"><div class=\"mini-card\">\n        <img src=\"../../../assets/blog/web-dev/creating-simple-website/mini-preview.jpg\" alt=\"image\" style=\"width:100%\"> \n        <div class=\"card-container\">\n          <br><h2><strong>Making A Simple Static Website using HTML and CSS</strong></h2><br>\n          <p style=\"text-align:center\"><a routerLink=\"/blog/website/making-a-simple-static-website-with-html-and-css\">Read More >></a></p>\n        </div>\n      </div></div><br><br>\n      <div class=\"column-3\"><div class=\"mini-card\">\n        <img src=\"../../../assets/blog/uni-life/1st-year-uni/mini-preview.jpg\" alt=\"image\" style=\"width:100%\"> \n        <div class=\"card-container\">\n          <br><h2><strong>How To Make The Most Out Of Your First Year At Uni</strong></h2><br>\n          <p style=\"text-align:center\"><a routerLink=\"/blog/uni/how-to-make-the-most-out-of-your-first-year-of-uni\">Read More >></a></p>\n        </div>\n      </div></div><br><br>\n    </div>\n    <br><br>\n    <!-- #endregion  -->\n  </div>\n";
