    /* harmony default export */


    __webpack_exports__["default"] = "<div class=\"parallax\" style=\"height: 350px; background-image: url('../../assets/projects/ice-capades/house-2.png');\"></div>\n<br>\n<h1><strong>Ice Capades</strong></h1><br>\n<!-- #region First download link -->\n<div class=\"center-download-container\">\n    <div class=\"download ice-capades-download\">\n        <p>Download game<a href=\"../../assets/downloads/IceCapades.zip\"> here.</a></p>\n    </div>\n</div><br><br>\n<!-- endregion -->\n<div class=\"written-content-container\">\n    <div class=\"written-content\">\n        <!-- #region About and Aim --> \n        <p class=\"subheading\"><strong>About the Game</strong></p>\n        <p>\n            Ice Capades is a Pokemon-style inspired game that aims to teach players about the affects of climate change on the environment. You must pass through multiple levels, \n            interact with objects, solve puzzles and avoid enemies in order to make your way to the oil rig that is causing the ice in your village to melt.\n        </p>\n        <br>\n        <p class=\"subheading\"><strong>Plot</strong></p>\n        <p>\n            You play as a penguin living in a village in Antarctica. Your village is supported by snow and ice. An oil rig has recently been \n            built nearby and its operations have been slowly melting the ice due to the heat and intense steam produced, therefore putting your village in danger.\n        </p>\n        <br>\n        <p class=\"subheading\"><strong>Aim</strong></p>\n        <p>\n            The aim of the game is to make your way to the oil rig by avoiding enemies, collecting items and interacting with objects to solving puzzles. \n            Once at the oil rig, you must destroy it by reaching and turning off the main power switch.\n        </p>\n        <br>\n        <!-- #endregion -->\n        <!-- #region Tutorial and Controls -->\n        <img src=\"../../assets/projects/ice-capades/story-help-1.PNG\" alt=\"image\" style=\"width:100%\"><br><br>\n        <p class=\"subheading\"><strong>Tutorial</strong></p>\n        <p>\n            When you start the game, you wake up inside your cottage. You are informed about the oil rig and how dangerous it is for the village. \n            This is the tutorial level where the game guides you through the basic gameplay.\n        </p>\n        <ul>\n          <li><b>How to interact with objects and the affects it has in the world.</b> For example, walking into the switch will activate the doors on the other side of the room).</li>\n          <li><b>How to use scrolls.</b> You cannot pass through certain doors that are locked.</li>\n          <li><b>Collecting collectables </b> such as diamonds or fish, which contribute to your points and leaderboard ranking.</li>\n        </ul><br>\n        <p class=\"subheading\"><strong>Controls</strong></p>\n        <ul>\n          <li><b> Walk. </b>Left, right, up or down arrow keys.</li>\n          <li><b> Interact/collect objects. </b>Walk into them.</li>\n        </ul><br>\n        <div class=\"rows\"> \n          <div class=\"column-2\">\n            <img src=\"../../assets/projects/ice-capades/IceCapades-menu-description.PNG\" alt=\"image\" style=\"width:100%\"><br><br><br>\n          </div>\n          <div class=\"column-2\">\n            <img src=\"../../assets/projects/ice-capades/IceCapades-menu-controls.PNG\" alt=\"image\" style=\"width:100%\">\n          </div>  \n        </div>\n        <!-- #endregion -->\n        <!-- #region Levels -->\n        <p class=\"subheading\"><strong>Levels</strong></p>\n        <p>Altogether there are 5 levels.</p>\n        <ul>\n          <li><b> Level 1 - </b>The cottage where you wake up and have the tutorial.</li>\n          <li><b> Level 2 - </b>The village outside, where you live.</li>\n          <li><b> Level 3 - </b>The forest outside the village (I seemed to have forgotten that Antarctica has no trees...).</li>\n          <li><b> Level 4 - </b>The underwater level, where you swim through to get to the oil rig.</li>\n          <li><b> Level 5 - </b>The oil rig.</li>\n        </ul><br>\n        <p>\n            Throughout the game you also come across other characters and animals that have been affected by the ice rig and melting ice.\n        </p>\n        <br>\n        <img src=\"../../assets/projects/ice-capades/story-help-2.png\" alt=\"image\" style=\"width:100%\"><br><br>\n        <p>\n            During the last level, you must navigate to the switch that shuts down the whole oil rig. Turning the switch off sets all the power reactors on fire, apparently.\n        </p>\n        <br> \n        <img src=\"../../assets/projects/ice-capades/fire.PNG\" alt=\"image\" style=\"width:100%\"><br><br>\n        <p>\n            After level 5 you are greeted by a thankful citizen who thanks you for saving the village from the ice rig that was melting the ice.\n        </p>\n        <br>\n        <img src=\"../../assets/projects/ice-capades/end-level.png\" alt=\"image\" style=\"width:100%\"><br>\n        <!-- #endregion -->\n        <!-- #region Characters, Collectables and Interactable -->\n        <br><br> \n        <p class=\"subheading\"><strong>Characters</strong></p>\n        <p>\n            The main character is the penguin (the player). There are different types of enemies for each level. Level 1 has polar bears, Level 2 has wolves, and Level 3 has Submarines and Jellyfish.\n        </p>\n        <br>\n        <p class=\"subheading\"><strong>Collectables</strong></p>\n        <ul>\n          <li><b>Fish: </b>Fish can be collected in order to score points throughout the game. These points add up to a total score at the end.</li>\n          <li><b>Scrolls: </b>There is a single scroll on every level. Each scroll has a question about climate change which must be answered correctly in order to get an extra 200 points.</li>\n          <li><b>Diamonds: </b>Similar to fish, these are collected in order to score points throughout the game. These are found more frequently and are therefore worth less points.</li>\n          <li><b>Chocolate Bar: </b>There is a single chocolate bar on every level. These are worth more points than fish and diamonds. There are usually puzzles that need to be solved in order to reach the chocolate bar.</li>\n        </ul><br>\n        <p class=\"subheading\"><strong>Interactables</strong></p>\n        <p> \n            Here are the things you can walk into which cause the environment to be affected:\n        </p>\n        <ul>\n          <li><b>Buttons: </b>Walking into these buttons would trigger certain blocks or stones to move allowing pathways to be cleared.</li>\n          <li><b>Keys: </b>Collecting keys allow you to open certain doors, including doors that lead to the next level.</li>\n        </ul><br>\n        <img src=\"../../assets/projects/ice-capades/gates.PNG\" alt=\"image\" style=\"width:100%\"><br><br><br>\n        <!-- #endregion -->\n    </div>   \n    <br>\n    <div class=\"center-download-container\">\n        <div class=\"download ice-capades-download\">\n            <p>Download game<a href=\"../../assets/downloads/IceCapades.zip\"> here.</a></p>\n        </div>\n    </div>\n    <br><br> \n</div>";
