    __webpack_exports__["default"] = "<div class=\"parallax\" style=\"height: 350px; background-image: url('../../assets/projects/racing-game/gameplay.PNG');\"></div>\n<br>\n<h1><strong>3D Street Racing Game</strong></h1><br>\n<!-- #region First download link -->\n<div class=\"center-download-container\">\n    <div class=\"download street-racing-game-download\">\n        <p>Download game<a href=\"https://github.com/vondreii/Modified-Street-Racing-Game\"> here.</a></p>\n        <p>View source code from<a href=\"https://github.com/vondreii/Modified-Street-Racing-Game\"> this repository</a> on Github.</p>\n    </div>\n</div><br><br>\n<!-- endregion -->\n<div class=\"written-content-container\">\n    <div class=\"written-content\">\n        <p class=\"subheading\"><strong>About the Game</strong></p>\n        <p>\n            This is a modified version of the street racing game sourced from <a href=\"https://github.com/Microsoft/Imagine_street-racing\">this Microsoft's Github repository</a>.\n            The original game is a 3D street racing game where the player must avoid the obstacles on the road. The player scores points when avoiding these obstacles. \n            The original game involved racing for as long as you possible without hitting any obstacles, as the speed increased. If you hit any obstacles during the game, the game would end.\n        </p>\n        <br>\n        <div style=\"text-align:center\">\n          <br><img src=\"../../assets/projects/racing-game/street-racing-preview.gif\" alt=\"image\" class=\"blog-image\"/>\n        </div><br><br>\n        <p>\n            The modified version includes several changes in the game mechanics. Instead of the speed increasing, the speed was set at a static 60km/h. \n            Extra obstacles were added such as roadblocks. You also could not die when hitting obstacles. The new game could also record all game statistics. This included things like:\n        </p>\n        <ul>\n          <li>The current coordinates of the player for every frame</li>\n          <li>The number of points added when passing cars</li>\n          <li>The number of times hit</li>\n          <li>The coordinates of new cars as they are being spawned</li>\n          <li>The player's movement patterns (the exact times they hit the left/right keys)</li>\n          <li>Total statistics, including accumulative car crashes and points totals </li>\n        </ul><br>\n        <div style=\"text-align:center\">\n          <br>\n          <img src=\"../../assets/projects/racing-game/roadblock.PNG\" alt=\"image\" class=\"blog-image\"/>\n        </div>\n        <br><br>\n        <p>\n            Data was collected as part of a University research project, therefore the game was also changed to automatically end after 5 minutes, and automatically repeat for 3 times.\n        </p>\n    </div>   \n    <br>\n    <div class=\"center-download-container\">\n        <div class=\"download street-racing-game-download\">\n        <p> Download game <a href=\"https://github.com/vondreii/Modified-Street-Racing-Game\"> here. </a></p>\n        <p> View source code from <a href=\"https://github.com/vondreii/Modified-Street-Racing-Game\"> this repository </a> on Github. </p>\n        </div>\n    </div>\n    <br><br> \n</div>\n";
